import React, { useState, useEffect } from 'react';
import expenseService from '../../services/expenseService';

const ExpenseHistory = () => {
  const [expenses, setExpenses] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState('all');
  const [error, setError] = useState('');

  useEffect(() => {
    fetchExpenses();
  }, []);

  const fetchExpenses = async () => {
    setLoading(true);
    try {
      const data = await expenseService.getMyExpenses();
      console.log('My expenses:', data);
      setExpenses(data);
      setError('');
    } catch (error) {
      console.error('Failed to fetch expenses:', error);
      setError('Failed to fetch expenses');
    } finally {
      setLoading(false);
    }
  };

  const getStatusIcon = (status) => {
    const icons = {
      Pending: '‚è≥',
      Approved: '‚úÖ',
      Rejected: '‚ùå',
      'In Progress': 'üîÑ',
    };
    return icons[status] || '‚è≥';
  };

  const getCategoryIcon = (category) => {
    const icons = {
      Travel: '‚úàÔ∏è',
      Food: 'üçî',
      Accommodation: 'üè®',
      'Office Supplies': 'üìé',
      Entertainment: 'üé¨',
      Other: 'üìã',
    };
    return icons[category] || 'üìã';
  };

  const filteredExpenses = expenses.filter((exp) => {
    if (filter === 'all') return true;
    return exp.status === filter;
  });

  const getStats = () => {
    return {
      total: expenses.length,
      pending: expenses.filter((e) => e.status === 'Pending' || e.status === 'In Progress').length,
      approved: expenses.filter((e) => e.status === 'Approved').length,
      rejected: expenses.filter((e) => e.status === 'Rejected').length,
    };
  };

  const stats = getStats();

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  return (
    <div className="expense-history">
      <h2>üìä My Expense History</h2>
      <p className="subtitle">Track all your submitted expenses and their approval status</p>

      {error && <div className="error">{error}</div>}

      <div className="stats-grid">
        <div className="stat-card total">
          <div className="stat-icon">üìã</div>
          <div className="stat-content">
            <h3>{stats.total}</h3>
            <p>Total Expenses</p>
          </div>
        </div>
        <div className="stat-card pending">
          <div className="stat-icon">‚è≥</div>
          <div className="stat-content">
            <h3>{stats.pending}</h3>
            <p>Pending</p>
          </div>
        </div>
        <div className="stat-card approved">
          <div className="stat-icon">‚úÖ</div>
          <div className="stat-content">
            <h3>{stats.approved}</h3>
            <p>Approved</p>
          </div>
        </div>
        <div className="stat-card rejected">
          <div className="stat-icon">‚ùå</div>
          <div className="stat-content">
            <h3>{stats.rejected}</h3>
            <p>Rejected</p>
          </div>
        </div>
      </div>

      <div className="filter-buttons">
        <button
          className={filter === 'all' ? 'active' : ''}
          onClick={() => setFilter('all')}
        >
          All
        </button>
        <button
          className={filter === 'Pending' ? 'active' : ''}
          onClick={() => setFilter('Pending')}
        >
          Pending
        </button>
        <button
          className={filter === 'In Progress' ? 'active' : ''}
          onClick={() => setFilter('In Progress')}
        >
          In Progress
        </button>
        <button
          className={filter === 'Approved' ? 'active' : ''}
          onClick={() => setFilter('Approved')}
        >
          Approved
        </button>
        <button
          className={filter === 'Rejected' ? 'active' : ''}
          onClick={() => setFilter('Rejected')}
        >
          Rejected
        </button>
      </div>

      {filteredExpenses.length === 0 ? (
        <div className="empty-state">
          <div className="empty-icon">üì≠</div>
          <p>No expenses found</p>
          <p>Submit your first expense to get started!</p>
        </div>
      ) : (
        <div className="expenses-table-container">
          <table className="modern-table">
            <thead>
              <tr>
                <th>Date</th>
                <th>Category</th>
                <th>Description</th>
                <th>Amount</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {filteredExpenses.map((expense) => (
                <tr key={expense._id}>
                  <td>{new Date(expense.date).toLocaleDateString()}</td>
                  <td>
                    <span className="category-badge">
                      {getCategoryIcon(expense.category)} {expense.category}
                    </span>
                  </td>
                  <td className="description-cell">{expense.description}</td>
                  <td className="amount-cell">
                    <strong>
                      ${expense.amount} {expense.currency}
                    </strong>
                  </td>
                  <td>
                    <span className={`status-badge status-${expense.status.toLowerCase().replace(' ', '-')}`}>
                      {getStatusIcon(expense.status)} {expense.status}
                    </span>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default ExpenseHistory;
